webpackJsonp([0x5c39352ed0bb],{433:function(e,t){e.exports={data:{markdownRemark:{html:'<h2>Cargo commands</h2>\n<p>Command to create a project:</p>\n<pre><code class="language-bash">cargo new hello\n</code></pre>\n<p>You can compile and run the project now with:</p>\n<pre><code class="language-bash">cargo run\n</code></pre>\n<p>This builds the project in a directory called <code>target/debug</code>.\nTo build the project in the <code>target/release</code> directory intended for prod, just run:</p>\n<pre><code class="language-bash">cargo run --release\n</code></pre>\n<p>A good tip to improve the code with idiomatic rust coding hints/warnings is to run:</p>\n<pre><code class="language-bash">cargo clippy\n</code></pre>\n<h2>Structs and Traits</h2>\n<pre><code class="language-rust">struct RedFox {\n    enemy: bool,\n    life: u32,\n}\n\ntrait Noisy {\n    fn get_noise(&#x26;self) -> &#x26;str;\n}\n\nimpl Noisy for RedFox {\n    fn get_noise(&#x26;self) -> &#x26;str { "Meow?" }\n}\n\nfn print_noise&#x3C;T: Noisy>(item: T) {\n    println!("", item.get_noise());\n}\n\nimpl Noisy for u8 {\n    fn get_noise(&#x26;self) -> &#x26;str { "BYTE!" }\n}\n\nfn main() {\n    print_noise(5_u8); // prints "BYTE!"\n}\n</code></pre>',frontmatter:{title:"Rust",date:"February 06, 2022",path:"/rust",tags:["rust"],excerpt:""}}},pathContext:{prev:{html:'<ul>\n<li><a href="https://docs.starport.com/guide/hello.html">Short documentation on starport</a></li>\n<li><a href="http://localhost:1317/">swagger view of the high-level blockchain API</a></li>\n</ul>\n<p>Execute <code>starport version</code> to find out your installed starport version.</p>',id:"/home/nicolas/projects/workshop/src/pages/2022-02-18-starport/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2022-02-18T10:17:00.823Z",path:"/starport",title:"Starport",excerpt:"",tags:["starport"]}},next:null}}}});
